import React from "react";
import styles from "../scss/home.module.scss";
import Test from "./test.svg";

const svgTest = `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 45 70"><defs><style>.cls-1{fill:none;stroke:#690519;stroke-linecap:round;stroke-linejoin:round;stroke-width:3px;}</style></defs><title>Asset 1</title><g id="Layer_2" data-name="Layer 2"><g id="Layer_1-2" data-name="Layer 1"><polyline class="cls-1" points="43.5 1.5 1.5 35.5 43.5 68.5"/></g></g></svg>`;
const Home = () => {
  return (
    <div>
      <div className={styles.heroContainer}>
        <Test />
      </div>
      <div>Nav panel</div>
    </div>
  );
};

export default Home;
